import axios from 'axios';

const baseUrl = 'http://localhost:8080/persons';

const getAll = () => {
	axios.get(baseUrl);
}

const create = newPersonObject => {
	axios.post(baseUrl, newPersonObject);
}

export default {getAll, create};
